import React from 'react';
import { Col, Row } from 'react-bootstrap';
import {useHistory} from 'react-router-dom'
import { NOTE_ROUTE } from '../utils/consts';

const Note = ({note}) => {

    const history = useHistory()

    return (
        <Row 
            key={note.id}
            onClick={() => history.push(NOTE_ROUTE + '/' + note.id)}
        >
            <Col md={4}>
                {note.title}
            </Col>
            <Col md={4}>
                {note.title}
            </Col>
            <Col md={4}>
                {note.title}
            </Col>
        </Row>
    );
};

export default Note;
